text:
*<!channel> добро пожаловать в канал `da_21_library` — канал-библиотеку* :books: *Тут мы делимся дополнительными тематическими материалами: статьями, ссылками на учебники и полезные книги, плейлистами в youtube и т.д.*

:orange_book: Чтобы сделать новую строчку в сообщении (и не писать несколько сообщений по одному слову) - нажимаем Shift + Enter;
:blue_book: Пользуемся тредами, чтобы обсудить классную ссылку в канале;
:green_book: Не сливаем сюда файлы книг — без разрешения от правообладателя, это не очень законно :zipper_mouth_face:
:ledger: Мы советуем к каждой ссылке добавить описание, о чём это / почему это круто, а также отмечать смайликами понравившиеся ресурсы :nerd_face:
